{"body": "select top 1
c.client_name
from b2b_clients c with (nolock) 
LEFT join b2b_apps a with (nolock) on c.id = a.client_id
left join b2b_client_api_auth_tokens t with (nolock) on c.id = t.client_id
where 1=1
and c.id = {{Input1.value}}
ORDER by client_name ASC", "operation": "run_sql", "usePreparedSql": true, "superblocksMetadata": {"pluginVersion": "0.0.7"}, "useAdvancedMatching": "auto"}

